import React from 'react';

const Rightside = () => {
    return (
        <div className='right-side'>
            <select>
                <option>Sokoto</option>
                <option>Rivers State</option>
                <option>Jos</option>
                <option>Abia</option>
            </select>
        </div>
    )
}

export default Rightside;
